"type":"uint256"},{"internalType":"uint256","name":"priceStep","type":"uint256"}],"internalType":"struct Auction.AuctionInformation","name":"","type":"tuple"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"getBidInformationByAuctionId","outputs":[{"components":[{"internalType":"address","name":"bidder","type":"address"},{"internalType":"uint256","name":"bidAmount","type":"uint256"},{"internalType":"enum Auction.BidderState","name":"bidderState","type":"uint8"}],"internalType":"struct Auction.BidInformation[]","name":"","type":"tuple[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"getHightestBidOfAuction","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"getIndexOfHighestBidOfAuction","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"getIndexOfSecondWinnerOfAuction","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"nonpayable","type":"function"},{"inputs":[],"name":"getListAuctionId","outputs":[{"internalType":"string[]","name":"","type":"string[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"payment","outputs":[],"stateMutability":"payable","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"},{"internalType":"uint256","name":"bidAmount","type":"uint256"}],"name":"placeBid","outputs":[],"stateMutability":"payable","type":"function"},{"inputs":[{"internalType":"string","name":"auctionId","type":"string"}],"name":"registerToBid","outputs":[],"stateMutability":"payable","type":"funct